module.exports = "<div id=\"fh5co-couple-story\">\r\n  <div class=\"container\">\r\n    <div class=\"row\">\r\n      <div class=\"col-md-8 col-md-offset-2 text-center fh5co-heading animate-box\">\r\n        <h2>Our Story</h2>\r\n        <p><i>\"To the world, you may be one person, but to one person you are the world.\" </i></p>\r\n      </div>\r\n    </div>\r\n    <div class=\"row\">\r\n      <div class=\"col-md-12 col-md-offset-0\">\r\n        <ul class=\"timeline animate-box\">\r\n          <li class=\"timeline-inverted animate-box\">\r\n            <div class=\"timeline-badge\" style=\"background-image:url(../../assets/images/lecture.jpg);\"></div>\r\n            <div class=\"timeline-panel\">\r\n              <div class=\"timeline-heading\">\r\n                <h3 class=\"timeline-title\">Early Days</h3>\r\n                <span class=\"date\">December, 2013</span>\r\n              </div>\r\n              <div class=\"timeline-body\">\r\n                <p>Our story began back in September 2013, when we were both freshers at Strathclyde University.\r\n                  During the campus introduction lecture, the presenter ended by joking that “uni life is exciting and unpredictable, and who knows, you might even marry the person sitting next to you”.\r\n                  Indeed Ira was actually sitting next to Des that day :) In fact she winked at Des jokingly, because she recognised him from the course and was in a giddy mood.\r\n                  Throughout the rest of the semester, we became good friends and in only a short few months fell in love!\r\n                </p>\r\n              </div>\r\n            </div>\r\n          </li>\r\n          <li class=\"animate-box\">\r\n            <div class=\"timeline-badge\" style=\"background-image:url(../../assets/images/denmark.jpg);\"></div>\r\n            <div class=\"timeline-panel\">\r\n              <div class=\"timeline-heading\">\r\n                <h3 class=\"timeline-title\">European Adventures</h3>\r\n                <span class=\"date\">Summer 2015</span>\r\n              </div>\r\n              <div class=\"timeline-body\">\r\n                <p>Our first big holiday together was an adventure all across Europe. We lived on a farm in Oersberg in the most northern reaches of Germany,\r\n                sampled the best life Christiania has to offer in Denmark and went sunbathing and swimming in Malta.</p>\r\n                <br>\r\n                <p>It was only that summer Ira found out that, while Des has been the knight in shining armour protecting her from spiders for years, he is actually scared of them himself!\r\n                This, admittedly, swept Ira off her feet all over again.</p>\r\n              </div>\r\n            </div>\r\n          </li>\r\n          <li class=\"timeline-inverted animate-box\">\r\n            <div class=\"timeline-badge\" style=\"background-image:url(../../assets/images/couple-3.jpg);\"></div>\r\n            <div class=\"timeline-panel\">\r\n              <div class=\"timeline-heading\">\r\n                <h3 class=\"timeline-title\">Life In Munich</h3>\r\n                <span class=\"date\">October 2015 - August 2016</span>\r\n              </div>\r\n              <div class=\"timeline-body\">\r\n                <p>Our next milestone was moving in together for a university exchange program in Munich for 12 months.\r\n                Along the way we met loads of amazing friends and shared so many wonderful experiences together!\r\n                It was also then that a piggy bank rule in our home was established, so Ira gets cheered up by a cute piggy\r\n                bank when picking up a neverending stream of coins Des manages to scatter around the house.</p>\r\n                <br>\r\n                <p>Also, living so close to the Alps was a hikers wet dream! 😂🚶‍♀️🚶‍♂️⛰️ </p>\r\n              </div>\r\n            </div>\r\n          </li>\r\n          <li class=\"animate-box\">\r\n            <div class=\"timeline-badge\" style=\"background-image:url(../../assets/images/heart.jpg);\"></div>\r\n            <div class=\"timeline-panel\">\r\n              <div class=\"timeline-heading\">\r\n                <h3 class=\"timeline-title\">A year apart</h3>\r\n                <span class=\"date\">September 2016 - August 2017</span>\r\n              </div>\r\n              <div class=\"timeline-body\">\r\n                <p>The next 12 months were a bit tougher as we split apart for the first time with Des living and working in Munich and Ira back in Glasgow studying.\r\n                  We braved through it and were reunited once again in Glasgow.</p>\r\n              </div>\r\n            </div>\r\n          </li>\r\n          <li class=\"timeline-inverted animate-box\">\r\n            <div class=\"timeline-badge\" style=\"background-image:url(../../assets/images/couple-5.jpg);\"></div>\r\n            <div class=\"timeline-panel\">\r\n              <div class=\"timeline-heading\">\r\n                <h3 class=\"timeline-title\">Proposal</h3>\r\n                <span class=\"date\">December 24, 2017</span>\r\n              </div>\r\n              <div class=\"timeline-body\">\r\n                <p>Following a build up of an advent calendar, which had photo albums of our adventures (linked via QR-Codes, of course.. did you expect no tech from the guy who wrote a birthday gift program :p ), the Christmas Eve album ended with the words \"close your eyes\" and when Ira opened them, Des was down on one knee asking her to be his wife.</p>\r\n                <br>\r\n                <p>No guesses as to what her response was 😉</p>\r\n              </div>\r\n            </div>\r\n          </li>\r\n        </ul>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</div>\r\n\r\n<div id=\"fh5co-counter\" class=\"fh5co-bg fh5co-counter\" style=\"background-image:url(../../assets/images/west_highland_way.jpg);\">\r\n  <div class=\"overlay\"></div>\r\n  <div class=\"container\">\r\n    <div class=\"row\">\r\n      <div class=\"col-md-8 col-md-offset-2 text-center fh5co-heading animate-box\">\r\n        <h2>Our Life Together</h2>\r\n        <span>So Far</span>\r\n      </div>\r\n    </div>\r\n    <div class=\"row\">\r\n      <div class=\"display-t\">\r\n        <div class=\"display-tc\">\r\n          <div class=\"col-md-3 col-sm-6 animate-box\">\r\n            <div class=\"feature-center\">\r\n              <span class=\"icon\">\r\n                <i class=\"icon-globe\"></i>\r\n              </span>\r\n\r\n              <span class=\"counter js-counter\" data-from=\"0\" data-to=\"10\" data-speed=\"2000\" data-refresh-interval=\"50\"></span>\r\n              <span class=\"counter-label\">Countries Visited</span>\r\n\r\n            </div>\r\n          </div>\r\n          <div class=\"col-md-3 col-sm-6 animate-box\">\r\n            <div class=\"feature-center\">\r\n              <span class=\"icon\">\r\n                <i class=\"icon-calendar\"></i>\r\n              </span>\r\n\r\n              <span class=\"counter js-counter\" data-from=\"0\" data-to=\"66\" data-speed=\"2000\" data-refresh-interval=\"50\"></span>\r\n              <span class=\"counter-label\">Months</span>\r\n            </div>\r\n          </div>\r\n          <div class=\"col-md-3 col-sm-6 animate-box\">\r\n            <div class=\"feature-center\">\r\n              <span class=\"icon\">\r\n                <i class=\"icon-paper-plane\"></i>\r\n              </span>\r\n              <span class=\"counter js-counter\" data-from=\"0\" data-to=\"5467\" data-speed=\"2000\" data-refresh-interval=\"50\"></span>\r\n              <span class=\"counter-label\">Miles Travelled</span>\r\n            </div>\r\n          </div>\r\n          <div class=\"col-md-3 col-sm-6 animate-box\">\r\n            <div class=\"feature-center\">\r\n              <span class=\"icon\">\r\n                <i class=\"icon-basecamp\"></i>\r\n              </span>\r\n\r\n              <span class=\"counter js-counter\" data-from=\"0\" data-to=\"13\" data-speed=\"2000\" data-refresh-interval=\"50\"></span>\r\n              <span class=\"counter-label\">Mountains Climbed</span>\r\n\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</div>\r\n"

